import React, { Component } from "react";
import cases from "./cases.json";
import Case from "../Case/Case";

export default class CaseList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      caseList: cases
    };
  }

  render() {
    return (
      <div className='case-list'>
        {this.state.caseList.map((value, index) => (
          <Case
            key={index}
            id={value.id}
            title={value.title}
            img={value.image}
          />
        ))}
      </div>
    );
  }
}
